package com.sajansthapit.authserver.config.bootstrap.dto;import java.util.List;public class BootstrapUserDto {    private String fullName;    private String email;    private String username;    private String password;    private List<String> roles;    public BootstrapUserDto() {    }    public BootstrapUserDto(String fullName, String email, String username, String password, List<String> roles) {        this.fullName = fullName;        this.email = email;        this.username = username;        this.password = password;        this.roles = roles;    }    public String getFullName() {        return fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public List<String> getRoles() {        return roles;    }    public void setRoles(List<String> roles) {        this.roles = roles;    }}